import { useEffect, useState } from "react";



function Ecdata(){

    const [data,setData]=useState([])

    useEffect(()=>{

        fetch("http://localhost:3005/E-commerce")
        .then((res) => {
            return res.json()
        })
        .then((resp) => {
            // console.log(resp)

            setData(resp)
        })
    },[])
    
    return(
        <div ClassName="container">

          {data.map((item)=>(
            <p><img src={item.img}/></p>
          ))}  

        </div>
    )
     
}
export default Ecdata;
